import React, { useEffect } from 'react';
import bgimg from './images/img-2.jpg';

import '../../App.css';

export default function Services() {
  useEffect(() => {
    window.scrollTo(0, 0)
  }, []);
  
  return (
    <>
      <img src={bgimg} />

      <h1 className='services'>SERVICES</h1>
    </>
  );
}
